By default, TypeSharp does not implement any utilities for generating random numbers, you'll need to include this from the standard library! You can achieve this in one of the following ways: Using the "use" keyword, for example: use std.math Using the "import" keyword, with js-like syntax: import { math } from 'std' With that said, we're going to stick to the first way, and the most standardized way of importing in TypeSharp. In your src/mod.ts file, add: use std.math; Making a working prototype Now that we have our import, we need to add the code to save a random number for the user to guess. By default, TypeSharp is strict . Meaning, variables are only mutable to it's predefined type. With that said, let's get some things working! Before we do anything, we need to tell the compiler that we would like to use lazy numbers, because they are not enabled by default, let's do that with the following: # compiler numerics-lazy Firstly we need to store the random number to the heap so we can check later if the user is guessing correctly, let's store this as a scoped constant. const rand_number: int = rand(0, 100); Next, before we can start checking inputs from the user, we need to make a function to verify if the guessed number is close to the rand_number . We're going to call this function "verify_number", however you can name it whatever you like. function verify_number(guess: int): bool { // ...
} Now we need to implement the checking for each guess, we're going to use some simple logic operations for this. If guess is higher than rand_number we will print "Guess is too high.", and if the guess is too low, we will print "Guess is too low". if (guess > rand_number) { println("Guess is too high.");
} else if (guess < rand_number) { println("Guess is too low.");
} else if (guess === rand_number) { return true;
}
return false; Great, we have the logic implemented, now we need to get an input from the user, and check if the input is equal to rand_number, if it is, end the program with a "GG, the number was: ". However in order to keep the game running, we're going to wrap this logic in a loop, and end when the verify_number function returns "true". We'll do this by using TypeSharp's standard input function from std.io.util.input, however we will import all io utilities with use std.io.util, so add this import to the top of your program now. function game_loop(): void { const guess: int = input("Guess a number from 1 - 100: ") ?? 0; const end_game: bool = verify_number(guess); if (end_game) { println("GG, the number was: " . rand_number); } else { game_loop(); }
} With this completed, we can simply invoke the game_loop function by using the @main decorator in TypeSharp; and after we do this our simple guessing program should now be complete! The final product should look similar to the following. # compiler numerics-lazy
use std.math;
use std.io.util; const rand_number: int = rand(0, 100); function verify_number(guess: int): bool { if (guess > rand_number) { println("Guess is too high."); } else if (guess < rand_number) { println("Guess is too low."); } else if (guess === rand_number) { return true; } return false;
} @main
function game_loop(): void { const guess: int = input("Guess a number from 1 - 100: ") ?? 0; const end_game: bool = verify_number(guess); if (end_game) { println("GG, the number was: " . rand_number); } else { game_loop(); }
}
